/**
 * Resets all Attributes in this AttributeSource by calling
 * {@link Attribute#clear()} on each Attribute.
 */
public void clearAttributes() {
  Iterator it = getAttributesIterator();
  while (it.hasNext()) {
    ((Attribute) it.next()).clear();
  }
}

